"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Dosage may need to be adjusted for renal or hepatic impairment, or concomitant use of other drugs.",
"     <br>",
"      &bull; Measurement of serum concentrations may be useful to guide therapy. Usual therapeutic serum concentrations are: carbamazepine 6-12 mcg/mL, phenobarbital 15-35 mcg/mL, phenytoin 10-20 mcg/mL, valproate 50-120 mcg/mL. Some patients achieve complete seizure control at lower concentrations, and occasional patients need higher concentrations.",
"      <br>",
"       &Delta; Not FDA-approved unless absence is involved.",
"       <br>",
"        &loz; Once daily for the extended-release formulation (Depakote ER).",
"        <br>",
"         &sect; FDA-approved for adjunctive therapy in adults and children &ge;2 years old with partial seizures, with Lennox-Gastaut syndrome or with primary generalized seizures, and as monotherapy in adults with partial seizures as a substitute for carbamazepine, phenytoin, phenobarbital or valproate.",
"         <br>",
"          &yen; Starting dosage is 25 mg every other day and maintenance dosage is 100 to 400 mg daily when given with valproate.",
"          <br>",
"           &Dagger; Starting dosage is 0.15 mg/kg daily and maintenance dosage is 1 to 5 mg/kg daily when given with valproate.",
"           <br>",
"            &dagger; Not FDA-approved for this indication.",
"            <br>",
"             ** Not FDA-approved for pediatric use.",
"             <br>",
"              &bull;&bull; Adjustments in maintenance dosage above 300 mg/day for adults should usually be made in 25- or 30-mg increments because metabolism becomes saturated.",
"             </br>",
"            </br>",
"           </br>",
